import React from 'react';
import './Footer.css'; // Make sure to create a CSS file for styling

const Footer = () => {
  return (
    <footer className="footer">
      <div className="footer-section">
        <h5>Home</h5>
        <ul>
          <li><a href="#home">About Us</a></li>
          <li><a href="#vision">Vision & Profile</a></li>
          {/* add other links */}
        </ul>
      </div>
      <div className="footer-section">
        <h5>Functional Unit</h5>
        <ul>
          <li><a href="#satcom">Satellite Communication</a></li>
          <li><a href="#infra">Infrastructure</a></li>
          {/* add other links */}
        </ul>
      </div>
      {/* Repeat for other sections */}
      <div className="footer-section">
        {/* ... */}
      </div>
    </footer>
  );
}

export default f;
